import React from 'react';


const Login = () => (
    <nav className="login">
        <h2>Inventory login</h2>
        <p>Sign in to manage your store's inventory</p>
        <button className="github" onClick={() => this.props.autheticate("Github")}></button>
    </nav>
)

Login.propType = {
    autheticate: PropType.func
}

export default Login;
